//		}
		return(
		<div>
			<ProfessionalPlayers PlayersInfo={props.PlayersInfo}/>
			<AmateurPlayer nameAmateurPlayer={props.nameAmateurPlayer} ageAmateurPlayer={props.ageAmateurPlayer}/>
		</div>
	)
}

export default Players;
